import MyContext from '../components/MyContext';

class Cadastrados extends React.Component {
  constructor(props) {
    super(props);
    this.state = {  }
  }
  render() { 
    return (
      <div className="cadastradosContainer">
          <MyContext.Consumer>
            {
              value => {
                value.BDcadastro.map((pessoa) => {
                  <p></p>
                  pessoa.name
                })
              }
            }
          </MyContext.Consumer>
      </div>
    );
  }
}

export default Cadastrados;
